import HomeScreen from './Screens/HomeScreen';
import { BrowserRouter ,Link,Route,Routes } from 'react-router-dom';


function App() {
  return (
    <BrowserRouter>
    <div >

      <header >

      <Navbar bg="dark" variant="dark">
            <Container>
              <LinkContainer to="/">
                <Navbar.Brand>amazona</Navbar.Brand>
              </LinkContainer>
            </Container>
          </Navbar>

       <Link to="/">bitbasket</Link> 
       {/* to avoid page refresh and display as (single page application)(SPA) */}
      </header>
      <main>
        <Routes>
          <Route path="/" element={<HomeScreen />}/>

        </Routes>

      </main>
    </div>
    </BrowserRouter>
  );
}

export default App;
